	getCachedData: function(cacheCallback, noCacheCallback) {

		try {
			if (window.localStorage && (JSON && JSON.parse) && window.localStorage.getItem('fw.map.time')) {
				var strCache = window.localStorage.getItem('fw.map.data'),
					now = new Date(),
					cacheDate = new Date(parseInt(window.localStorage.getItem('fw.map.time'))),
					elapsed = (now - cacheDate) / 3600000; // hours

				if (strCache && elapsed < this.cacheExpiresTime) {
					var jsonData = JSON.parse(strCache);

					if (jsonData.range.endDate == this.lastDate) {
						setTimeout(function() {
							cacheCallback(jsonData);
						}, 1000);
					} else {
						this.clearCache();
						noCacheCallback();
					}

				} else {
					this.clearCache();
					noCacheCallback();
				}
			} else {
				noCacheCallback();
			}
		} catch (e) {
			noCacheCallback();
		}
	},

