	getPeriodData: function(startDate, endDate) {
		var _this = this,
			percentageList = [];

		while (!this.organizedData.snapshots[endDate] && endDate > startDate) {
			endDate -= this.dayInMiliseconds;
		}

		for (var i in this.organizedData.snapshots[startDate].instruments) {
			var secondValue = this.organizedData.snapshots[endDate].instruments[i].value,
				firstValue = this.organizedData.snapshots[startDate].instruments[i].value,
				performance = parseFloat(((secondValue - firstValue) / firstValue) * 100);

			this.countryPerformance.indexes[i].val1 = firstValue;
			this.countryPerformance.indexes[i].val2 = secondValue;
			this.countryPerformance.indexes[i].performance = performance;

			percentageList.push(performance);
		}

		if (this.cache && this.time) {
			this.cache[this.time] = {};
			this.cache[this.time].performance = _this.countryPerformance;
			this.cache[this.time].percentageList = percentageList;
		}

		this.definePerformanceLevels(percentageList);

		this.applyColors();

		this.requests++;
		this.busy = false;
		this.loadCountryMarkers();
	},

	handlePointEvent: function(e) {
		//check for touches
		if (e.originalEvent.touches) {
			e.offsetX = e.originalEvent.touches[0].pageX - jQuery(e.target).offset().left;
		}
		var offset = (e.offsetX || e.clientX - jQuery(e.target).offset().left);
		return offset;
	},

	handleWeekend: function(weekDay, forward) {
		var res = 0;

		if (weekDay == 0) { // is Sunday
			// play or move next
			res = forward ? 1 : -2;
		} else if (weekDay == 6) { // is Saturday
			// play or move next
			if (forward) {
				res = 2;
			} else {
				res = this.sameDay ? 2 : -1;
			}
		}

		return res;
	},

