	/* decide the direction that the tooltip is going to open */
	overMarker: function(e, elm) {
		var _this = this,
			map = jQuery('#' + this.mapID),
			mapLeft = map.offset().left,
			mapTop = map.offset().top,
			mouseX = e.clientX - mapLeft,
			width = parseInt(map.css('width')),
			height = parseInt(map.css('height')),
			mapHalfWidth = width / 2,
			diff = 0;

		this.loadTooltip(elm);

		var top = (elm.offset().top - mapTop) - 30,
			left = (elm.offset().left - mapLeft),
			tooltipFullWidth = 231 + 30,
			tooltipHeight = 62,
			diff = 0;

		if (mouseX > mapHalfWidth) {

			if (tooltipFullWidth > left) {
				diff = tooltipFullWidth - left;
				left -= tooltipFullWidth - diff;
			} else {
				left -= tooltipFullWidth;
			}
		} else {

			if (tooltipFullWidth > (width - (left + 30))) {
				diff = tooltipFullWidth - (width - (left + 30));
				left += 30 - diff;
			} else {
				left += 30;
			}
		}

		if (top < 0) {
			top = top - top;
		} else if (top > (height - 82)) {
			top = height - 82;
		}


		this.toolContainer.find('.tt-box').css({
			'top': top,
			'left': left,
			'display': 'block',
			'position': 'absolute'
		});

		if (!_this.isTouchDevice) {
			this.toolContainer.find('.tt-box').on('mouseleave', function(e) {
				var ms = 1000;
				clearTimeout(_this.tooltipTimerClose);
				_this.tooltipTimerClose = setTimeout(function() {
					_this.hideMarkerTooltip();
				}, ms);
			});

			this.toolContainer.find('.tt-box').on('mouseenter', function(e) {
				clearTimeout(_this.tooltipTimerClose);
			});
		}
	},

