	setMonthLabels: function() {
		var monthsLabels = [],
			begin = new Date((this.date.getFullYear() - 1), this.date.getMonth(), (this.date.getDate() - 1)),
			counter = 0;

		for (var i = 1; i <= 10; i += 3) {
			var date = new Date((this.date.getFullYear() - 1), (begin.getMonth() + i), (this.date.getDate() - 1)),
				year = date.getFullYear(),
				monthAbbr = this.monthsAbbrI18N[date.getMonth()],
				shortYear = '';

			year = year.toString();

			switch (this.factbookLocaleId) {
				case 'JAJP':
					shortYear = year.substr(2, 2) + '年';
					break;
				case 'ZHTW':
					shortYear = year + '年';
					year.substr(2);
					break;
				case 'KOKR':
					shortYear = year.substr(2, 2) + '년';
					year.substr(2);
					break;
				default:
					shortYear = year.substr(2, 2);
					year.substr(2, 2);
			}

			if (this.factbookLocaleId == 'ZHTW') {
				monthsLabels[counter] = shortYear + '' + monthAbbr;
			} else if (this.factbookLocaleId == 'KOKR') {
				monthsLabels[counter] = shortYear + ' ' + monthAbbr;
			} else {
				monthsLabels[counter] = monthAbbr + ' ' + shortYear;
			}
			counter++;
		}

		var daysInMonth = this.daysInMonth((begin.getMonth() + 1), begin.getFullYear()),
			percentDays = Math.floor(begin.getDate() / (daysInMonth / 100)),
			//liPercentTotalWidth = 8.33,
			liFirstWidth = 8.33 * ((100 - percentDays) / 100),
			liLastWidth = 8.33 * (percentDays / 100),
			liTagable = 0,
			tabMonth = this.toolContainer.find('.tab-month');

		tabMonth.find('.first').css('width', liFirstWidth + '%');
		tabMonth.find('.last').css('width', liLastWidth + '%');

		tabMonth.find('li').each(function(index) {
			var li = jQuery(this);

			if (li.find('span').length > 0) {
				return;
			}

			li.html(monthsLabels[liTagable]);
			liTagable++;
		});
	},

