	/* deal with the case of the last date coming from the request range be different of the last date requested */
	treatMissingData: function(data) {
		var _this = this;

		lastDateReturned = data.range.endDate;

		if (lastDateReturned != _this.lastDate) {

			diff = (_this.lastDate - lastDateReturned) / _this.dayInMiliseconds;
			_this.maxDays -= diff;
			_this.posEnd -= diff;
			_this.sliderRange.dragslider('option', 'max', _this.maxDays);

			/* setting period text */
			_this.period.html(_this.buildFormalDate(_this.firstDate) + ' - ' + _this.buildFormalDate(lastDateReturned));

			/* small fix for IE7 */
			if (_this.requests == 0) {
				setTimeout(function() {
					_this.updateTimeBarValue(_this.posStart, _this.posEnd);
				}, 500);
			} else {
				_this.updateTimeBarValue(_this.posStart, _this.posEnd);
			}

			_this.sliderRange.dragslider("values", [_this.posStart, _this.posEnd]);
			_this.lastDate = lastDateReturned;

		}

	},

