FWAPP.core.Util = Class.extend({
	init: function() {

	},

	getTransitionString: function() {
		var t,
			el = document.createElement('fakeelement'),
			transitions = {
				'transition': 'transitionend',
				'OTransition': 'oTransitionEnd',
				'MozTransition': 'transitionend',
				'WebkitTransition': 'webkitTransitionEnd',
				'msTransition': 'msTransitionEnd'
			};

		for (t in transitions) {
			if (transitions.hasOwnProperty(t) && el.style[t] !== undefined) {
				return transitions[t];
			}
		}
	}
});

FWAPP.core.ClientDetector = Class.extend({
	init: function() {
		this.userAgent = navigator.userAgent.toLowerCase();

		var data = {
			browser: null,
			version: null,
			os: null,
			isTouchDevice: false,
			osVersion: null,
			compMode: false,
			isIEold: false,
			ltIE7: false,
			isIE9: false,
			dualContainer: false
		};

		if (this.userAgent.search('android') != -1) {
			var i = this.userAgent.search('android ');

			data.os = 'android';
			data.isTouchDevice = true;
			data.browser = 'safari';
			data.osVersion = parseFloat(this.userAgent.substr((i + 8)));
		} else {
			if (this.userAgent.search('firefox') != -1) {
				data.browser = 'firefox';
			} else if (this.userAgent.search('chrome') != -1) {
				data.browser = 'chrome';
			} else if (this.userAgent.search('safari') != -1) {
				data.browser = 'safari';
			} else if (this.userAgent.search('opera') != -1) {
				data.browser = 'opera';
			} else if (this.userAgent.search('msie') != -1) {
				data.browser = 'msie';
			} else {
				data.browser = 'unknown';
			}

			if (this.userAgent.search('windows') != -1) {
				data.os = 'windows';

				if (this.userAgent.search('windows nt 6.1') != -1) {
					data.osVersion = 'seven';
				} else if (this.userAgent.search('windows nt 6.0') != -1) {
					data.osVersion = 'vista';
				}
			} else if (this.userAgent.search('linux') != -1) {
				data.os = 'linux';
			} else if (this.userAgent.search('ipad') != -1 || this.userAgent.search('iphone') != -1) {
				var i = this.userAgent.search('os ');

				data.osVersion = parseFloat(this.userAgent.substr((i + 3)));
				data.os = this.userAgent.search('ipad') != -1 ? 'ipad' : 'iphone';
				data.isTouchDevice = true;
			} else if (this.userAgent.search('mac') != -1) {
				data.os = 'mac';
			} else {
				data.os = 'unknown';
			}

			if (data.browser == 'firefox' || data.browser == 'chrome') {
				var i = this.userAgent.search(data.browser + '/');
				data.version = parseFloat(this.userAgent.substr((i + data.browser.length + 1)));
			} else if (data.browser == 'safari' || data.browser == 'opera') {
				var i = this.userAgent.search('version/');
				data.version = parseFloat(this.userAgent.substr((i + 8)));
			} else if (data.browser == 'msie') {
				var i = this.userAgent.search('msie ');
				data.version = parseFloat(this.userAgent.substr((i + 5)));
				if ((this.userAgent.search('trident/4.0') != -1 || this.userAgent.search('trident/5.0') != -1) && (data.version == 7)) {
					//compatibility mode detection
					data.compMode = true;
				}
			} else {
				data.version = '0';
			}
		}

		this.data = data;

		this.flags();
	},

	flags: function() {
		if (!this.data.isTouchDevice) {
			this.data.isTouchDevice = Modernizr.touch;
		}

		/* setup flags for fallback an dual container */
		switch (this.data.browser) {
			case 'msie':
				if (this.data.version < 9) {
					this.data.isIEold = true;
				}

				if (this.data.version <= 7) {
					this.data.ltIE7 = true;
				}

				if (this.data.version >= 9) {
					this.data.isIE9 = true;
				}
			case 'firefox':
			case 'chrome':
			case 'safari':
				this.data.dualContainer = true;
				break;
			default:
				this.data.dualContainer = false;
		}

		switch (this.data.os) {
			case 'android':
				this.data.dualContainer = true;
		}
	}
})

